import { Link } from 'react-router-dom';
import { withRouter} from "react-router-dom";
import LoginButton from '../LoginButton/LoginButton';

function Navigation(props) {
  return (
    <nav className="navigation">
      <ul 
        className={props.isLogged 
          ? "navigation__content navigation_logged" 
          : "navigation__content navigation_not-logged"}
      >
        <li className={window.location.href.includes("/saved-news") ? "navigation__item navigation__item_black" : "navigation__item"}>
          <Link className="navigation__link" to="/">Home</Link>
        </li>
        <li 
          className={ props.isLogged 
            ? window.location.href.includes("/saved-news") ? "navigation__item navigation__item_black" : "navigation__item" 
            :  "navigation__item_not-logged"}>
          <Link className="navigation__link" to="/saved-news">Saved articles</Link>  
        </li> 
        <li className="navigation__item">
          <LoginButton isLogged={props.isLogged} name={props.name}/>  
        </li>           
      </ul>  
        
        
    </nav>
  );
}

export default withRouter(Navigation);
